import{_ as e,o as t,c as a,e as r}from"./chunks/framework.78e651f5.js";const s="/assets/RLBVHTHic2k.83092a29.jpg",k=JSON.parse('{"title":"Открытая мастерская на Делай Саммите на Флаконе","description":"","frontmatter":{"title":"Открытая мастерская на Делай Саммите на Флаконе","date":"2015-05-18","cover":"2.jpg"},"headers":[],"relativePath":"practice/event/otkrytaya-masterskaya-na-delaj-sammite/index.md","filePath":"practice/event/otkrytaya-masterskaya-na-delaj-sammite/index.md"}'),n={name:"practice/event/otkrytaya-masterskaya-na-delaj-sammite/index.md"},o=r('<p><img src="'+s+'" alt=""></p><p>Последние выходные весны обещают быть жаркими. На весь уикенд <strong>дизайн-завод Флакон</strong> станет площадкой для проведения <strong>Делай Саммита 2015</strong>.</p><p>За два дня на Саммите будут представлены успешные действующие городские инициативы, «низовые инструменты» для трансформации города и развития городских объединений, пройдут дискуссии, воркшопы по самостоятельному изучению и преобразованию городского пространства. Организаторы мероприятия: Департамент культуры города Москвы, Московский молодёжный многофункциональный центр (МММЦ), Марафон городских действий «Делай Сам».</p><p>OOLEY прикатит на Саммит свою передвижную открытую мастерскую OOLEY42 и станет сердцем большого открытого творческого пространства, которое будет организовано на заднем дворе. На улице будут расставлены столы и навесы и оборудованы места для проведения мастер-классов и воплощения спонтанных идей посетителей. Мы предложим возможность поучаствовать в создании различных несложных проектов на один день, а гости Саммита смогут, включив фантазию, придумать воплотить свои собственные идеи создания, переделки или ремонта предметов. Можно будет переделать свой велосипед, выпилить любую фигурку из дерева, сшить сумку или кошелёк, раскрашивать поверхности акриловыми красками. Мы уже вовсю готовимся к этому событию, но еще есть время и вам подключиться к организации или принять участие в проведении события вместе с нами. Нам очень нужны смышлёные головы и умелые руки для того, чтобы сделать это событие знаковым в истории города. Не упустите уникальный шанс активно и продуктивно провести выходные с командой OOLEY и других мастерских.</p><p>По вопросам участия в подготовке и проведении события пишите нам на <a href="mailto:o@ooley.ru" target="_blank" rel="noreferrer">o@ooley.ru</a></p><p>Для регистрации и просмотра расписания Саммита пройдите по ссылке <a href="https://mymfc.timepad.ru/event/204611/" class="external-link" target="_blank" rel="noreferrer">https://mymfc.timepad.ru/event/204611/</a></p>',6),p=[o];function c(i,_,m,l,d,f){return t(),a("div",null,p)}const g=e(n,[["render",c]]);export{k as __pageData,g as default};
